import boardData from '../util/board'

export default function WorkSpace() {
    const dt = boardData()

    const tbdt = dt.map(d1 => {
        return <tr>{
            d1.map(d2 => {
                return (
                    <td style={{backgroundColor: d2.color}}> </td>
                )
            })
        }</tr>
    })

    return (
        <table>
            {tbdt}
        </table>
    )
}
